import React from "react";
import "../css/bookAppointment.css";
import AppointmentImg from "../img/appointmentImg.jpeg";

function BookAppointment() {
  return (
    <section className="bookAppointment">
      <div className="bookAppointmentBlock">
        <img src={AppointmentImg} alt="AppointmentImg"></img>
        <article>
          <h2>Book An Appointment</h2>
          <p>Please Call Us To Ensure</p>
          <div className="bookAppointmentLine"></div>
          <form className="bookAppointmenFormLeft">
            <select>
              <option value="Urologist">Urologist</option>
              <option value="Dantist">Dantist</option>
              <option value="Sergery">Sergery</option>
            </select>
            <div className="formBox">
              <input type="text" placeholder="Your Name" />
            </div>

            <input type="tel" placeholder="Your Phone" />
          </form>
        </article>
      </div>
    </section>
  );
}
export default BookAppointment;
